import React from "react";

class Footer extends React.Component {
	render() {
		return (
<footer className="footer text-center" id="about">
  <div className="container">
    <div className="row">
      {/* Footer Location */}
      <div className="col-lg-3 mb-8 mb-lg-0">
        <h4 className="text-center mb-4">:כתובת</h4>
        <p className="lead mb-0">,קריית-שמונה
          <br />האצ"ל 20 - <br /> אחד-העם 9 -</p>
      </div>
      {/* Footer Number */}
      <div className="col-lg-3 mb-8 mb-lg-0">
        <h4 className="text-center mb-4">:מספר</h4>
        <i className="fas fa fa-phone mr-2" />        
        <p className="lead mb-0">
          <br />052-4764379 - אור
          <br />054-7303575 - דוד
        </p></div>
      {/* Footer Social Icons */}
      <div className="col-lg-3 mb-8 mb-lg-0">
        <h4 className="text-center mb-4">:מצא אותנו בפסייבוק</h4>
        <a className="btn btn-outline-light btn-social mx-1" href="https://www.facebook.com/or.izhari">
          <i className="fab fa-fw fa-facebook-f" />
        </a>
        <a className="btn btn-outline-light btn-social mx-1" href="https://www.facebook.com/profile.php?id=100000274645145">
          <i className="fab fa-fw fa-facebook-f" />
        </a>
      </div>
      {/* Footer About Text */}
      <div className="col-lg-3">
        <h4 className="text-center mb-4">:קצת עלינו</h4>
        <p className="lead mb-0">.סטודנטים למדעי המחשב שנה אחרונה במכללת תלי-חי
        </p></div>
    </div>
  </div>
</footer>

		);
	}
}

export default Footer;
